void pushButtonMovement(int shiftx, int shifty){
    if((*(KEYs) & 0b0001) == 0b0001){
            *(KEYs + 3) = 0b0001;
            shiftx += 5;
        }
        else if((*(KEYs) & 0b0010) == 0b0010){
            *(KEYs + 3) = 0b0010;
            shiftx -= 5;
        }

        if((*(KEYs) & 0b1000) == 0b1000){
            *(KEYs + 3) = 0b1000;
            shifty += 5;
        }
        else if((*(KEYs) & 0b0100) == 0b0100){
            *(KEYs + 3) = 0b0100;
            shifty -= 5;
        }
}

